import BookShelf from './BookShelf'
import Furniture from "./Furniture"
// [bookShelfImg, door, clock, organ,  sideWaysCabinet,  sideWaysCabinetTwo, stairs, window, chessBoard, roundTable, longTable, bed, kitchenCounter, dresser, dresser2, mirror, largerCabinet, filledBookShelf, halfFullBookShelf]

function generateKitchenFurniture(p, furniture, collisonObj) {
    let posX = p.width/1.06
    let posY =  p.height/2
    
    let coffeeTable1Specs = {posX: p.width/2.4, posY:p.height/2.3, width: p.width/24, height:p.height/7 }
    let coffeeTable2Specs = {posX: p.width/2.4, posY:p.height/1.4, width: p.width/24, height:p.height/7 }
    let coffeeTable3Specs = {posX: p.width/1.7, posY:p.height/1.4, width: p.width/24, height:p.height/7 }
    let coffeeTable4Specs = {posX: p.width/1.7, posY:p.height/2.3, width: p.width/24, height:p.height/7 }
    let coffeeTable1 = new Furniture(p, furniture[19], coffeeTable1Specs.posX, coffeeTable1Specs.posY, coffeeTable1Specs.width, coffeeTable1Specs.height, collisonObj)
    let coffeeTable2 = new Furniture(p, furniture[19], coffeeTable2Specs.posX, coffeeTable2Specs.posY, coffeeTable2Specs.width, coffeeTable2Specs.height, collisonObj)
    let coffeeTable3 = new Furniture(p, furniture[19], coffeeTable3Specs.posX, coffeeTable3Specs.posY, coffeeTable3Specs.width, coffeeTable3Specs.height, collisonObj)
    let coffeeTable4 = new Furniture(p, furniture[19], coffeeTable4Specs.posX, coffeeTable4Specs.posY, coffeeTable4Specs.width, coffeeTable4Specs.height, collisonObj)

    coffeeTable1.render()
    coffeeTable2.render()
    coffeeTable3.render()
    coffeeTable4.render()
    let bookShelfHeight 
    let bookShelfWidth
    for(let wCounter = 0; wCounter<p.windowWidth*.75; wCounter+=bookShelfWidth){
        p.image(furniture[18], wCounter , p.height/20,  p.width/24, p.height/7)
    }
  
}

